import React from 'react';
import Carrousel from './Carrousel';
import CountDown from "./CountDown";


const Featured = () => {
    return (
        <div style={{position:"relative"}}>
            <Carrousel/>
            <div className="artist_name">
                <div className="wrapper">
                    IECI Summit
                </div>
            </div>
            <CountDown/>
        </div>
    );
};

export default Featured;
